import { useHistory } from "react-router-dom";
import { Box, Button, TextField } from "@mui/material";

const modalStyle = {
  position: "absolute",
  top: "50%",
  left: "50%",
//   textAlign: "center",
  transform: "translate(-50%, -50%)",
  width: "80%",
  maxWidth: "500px",
  bgcolor: "background.paper",
  border: "2px solid #000",
  boxShadow: 24,
  p: 4,
  borderRadius: "10px",
};

const LoginForm = (props) => {
  //   const history = useHistory();
  // const handleClose = () => history.push('/welcome');
  return (
    <Box sx={modalStyle}>
      <TextField fullWidth label="Email Address" margin="normal" name="email" type="email" variant="outlined">
        Email
      </TextField>
      <TextField fullWidth label="Password" margin="normal" name="password" type="password" variant="outlined">
        Password
      </TextField>
      <Button color="primary.black" fullWidth size="large" variant="contained">Log In</Button>
    </Box>
  );
};

export default LoginForm;
